import React from 'react';
import ReactDOM from 'react-dom';
// import sum,{sub , mult , div} from './App';
// import Heading from './Heading';
// import List from './List';
// import App from './App';
import "./index.css";
import Card from './Cards';
import Sdata from './Sdata';

// console.log();
function ncard() {

}

ReactDOM.render(
    <>
        <h1 className="heading_style">List of top 5 Netflix Series</h1>

        <Card
            imgscr={Sdata[0].imgscr}
            title={Sdata[0].title}
            sname={Sdata[0].sname}
            link={Sdata[0].links}
        />

        <Card
            imgscr={Sdata[1].imgscr}
            title={Sdata[1].title}
            sname={Sdata[1].sname}
            link={Sdata[1].links} />

        <Card
            imgscr={Sdata[2].imgscr}
            title={Sdata[2].title}
            sname={Sdata[2].sname}
            link={Sdata[2].links} />

        <Card
            imgscr={Sdata[3].imgscr}
            title={Sdata[3].title}
            sname={Sdata[3].sname}
            link={Sdata[3].links} />

         Sdata.map(ncard);
    </>,
    document.getElementById('root'));
